    - ID: "625f32a7-8b24-4b35-8f6f-1464da77bc40"
      Hint: Content
      Value: |
        Mosquitoes are a vector for a variety of diseases including West Nile virus, Eastern Equine Encephalitis, Dengue and chikungunya, as well as the emerging threat of Zika virus. Mosquito-borne diseases are a serious public health concern and according to the CDC, they are among the most complex of all infectious diseases to control. Arm yourself with information about the specific illnesses and how to reduce the risk of infection.<br />
